    true,nt"url": null,nt"notes": "<p>The Long-Term Care Minimum Data Set (MDS)
    is a standardized, primary screening and assessment tool of health status that forms
    the foundation of the comprehensive assessment for all residents in a Medicare and-or
    Medicaid-certified long-term care facility. The MDS contains items that measure
    physical, psychological and psychosocial functioning. The items in the MDS give
    a multidimensional view of the patients functional capacities and helps staff to
    identify health problems.</p>n",nt"license_title": "Other License Specified",nt"extras":
